import React, { useState, useEffect } from 'react';
import { motion, AnimatePresence } from 'framer-motion';
import { Menu, X, MapPin, ShieldCheck } from 'lucide-react';
import { Link as ScrollLink, animateScroll as scroll } from 'react-scroll';

const navItems = [
  { name: 'Home', to: 'hero' },
  { name: 'Services', to: 'services' },
  { name: 'Pricing', to: 'pricing' },
  { name: 'Results', to: 'results' },
  { name: 'About', to: 'about' },
  { name: 'Contact', to: 'contact' },
];

const Navbar = () => {
  const [isOpen, setIsOpen] = useState(false);
  const [scrolled, setScrolled] = useState(false);

  useEffect(() => {
    const handleScroll = () => {
      setScrolled(window.scrollY > 10);
    };
    window.addEventListener('scroll', handleScroll);
    return () => window.removeEventListener('scroll', handleScroll);
  }, []);

  return (
    <nav className={`fixed w-full z-50 transition-shadow duration-300 font-sans ${scrolled ? 'shadow-lg' : 'shadow-none'} bg-[#0F172A]`}> 
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="flex items-center justify-between h-16">
          {/* Logo */}
          <motion.div
            initial={{ opacity: 0, x: -20 }}
            animate={{ opacity: 1, x: 0 }}
            className="flex items-center space-x-2 cursor-pointer"
            onClick={() => scroll.scrollToTop()}
          >
            <div className="w-9 h-9 bg-gradient-to-br from-[#0F172A] to-[#F97316] rounded-lg flex items-center justify-center">
              <MapPin className="w-5 h-5 text-white" />
            </div>
            <span className="text-2xl font-extrabold text-white tracking-tight">Rankly360</span>
          </motion.div>

          {/* Desktop Navigation */}
          <div className="hidden md:flex items-center space-x-2">
            {navItems.map((item) => (
              <ScrollLink
                key={item.name}
                to={item.to}
                smooth={true}
                duration={500}
                offset={-70}
                className="relative px-3 py-2 text-white font-medium cursor-pointer transition-colors duration-200 hover:text-[#F97316] focus:outline-none group"
                activeClass="text-[#F97316]"
              >
                <span>{item.name}</span>
                <span className="absolute left-0 -bottom-1 w-0 h-0.5 bg-[#F97316] transition-all duration-300 group-hover:w-full group-hover:h-0.5"></span>
              </ScrollLink>
            ))}
            {/* CTA Button */}
            <motion.a
              whileHover={{ scale: 1.07, boxShadow: '0 0 16px #F97316' }}
              whileTap={{ scale: 0.97 }}
              href="#contact"
              className="ml-4 bg-[#F97316] text-white font-bold px-5 py-2 rounded-xl shadow transition-all duration-300 hover:shadow-orange-400/70 focus:outline-none focus:ring-2 focus:ring-[#F97316] focus:ring-offset-2 animate-pulse hover:animate-none"
            >
              Book Free Audit
            </motion.a>
          </div>

          {/* Mobile menu button */}
          <div className="md:hidden flex items-center">
            <button
              onClick={() => setIsOpen(!isOpen)}
              className="text-white hover:text-[#F97316] transition-colors duration-200 focus:outline-none"
            >
              {isOpen ? <X className="w-7 h-7" /> : <Menu className="w-7 h-7" />}
            </button>
          </div>
        </div>
      </div>
      {/* Mobile Navigation */}
      <AnimatePresence>
        {isOpen && (
          <motion.div
            initial={{ x: '100%' }}
            animate={{ x: 0 }}
            exit={{ x: '100%' }}
            transition={{ type: 'spring', stiffness: 300, damping: 30 }}
            className="fixed inset-0 z-50 bg-[#0F172A]/95 backdrop-blur-sm md:hidden flex flex-col"
          >
            <div className="flex items-center justify-between h-16 px-4">
              <span className="text-2xl font-extrabold text-white">Rankly360</span>
              <button onClick={() => setIsOpen(false)} className="text-white hover:text-[#F97316]">
                <X className="w-7 h-7" />
              </button>
            </div>
            <div className="flex-1 flex flex-col items-center justify-center space-y-8">
              {navItems.map((item) => (
                <ScrollLink
                  key={item.name}
                  to={item.to}
                  smooth={true}
                  duration={500}
                  offset={-70}
                  className="text-white text-2xl font-semibold cursor-pointer hover:text-[#F97316] transition-colors duration-200"
                  onClick={() => setIsOpen(false)}
                >
                  {item.name}
                </ScrollLink>
              ))}
              <a
                href="#contact"
                className="bg-[#F97316] text-white font-bold px-8 py-3 rounded-xl shadow transition-all duration-300 hover:shadow-orange-400/70 focus:outline-none focus:ring-2 focus:ring-[#F97316] focus:ring-offset-2 animate-pulse hover:animate-none"
                onClick={() => setIsOpen(false)}
              >
                Book Free Audit
              </a>
            </div>
          </motion.div>
        )}
      </AnimatePresence>
    </nav>
  );
};

export default Navbar;
